import React from 'react';
import logo from '../Assets/ss.png';
import cart from '../Assets/cart.png';

export const Navbar = () => {

    const [menu, setMenu] = useStarte("home");

    return (
        <div className='navbar'>
            <div className="nav-logo">
                <img src={logo} alt="" />
                <p>Home Made</p>
            </div>
            <ul className="nav-menu">
                <li onClick={() => { setMenu("home"); }}>Home{menu === "home" ? <h /> : <></>}</li>
                <li onClick={() => { setMenu("recipes"); }}>Recipes{menu === "recipes" ? <h /> : <></>}</li>
                <li onClick={() => { setMenu("td"); }}>TD{menu === "td" ? <h /> : <></>}</li>
            </ul>
            <div className="nav-login-cart">
                <button>Login</button>
                <img src={cart} alt="" />
                <div className="nav-cart-acount">0</div>

            </div>
        </div>
    );
};
